import { Navigate, Outlet, Route, Routes } from "react-router-dom";
import { PageTitle } from "../../../../_metronic/layout/core";
import ChiTietYeuCauLienKetDuocSi from "./yeu-cau-lien-ket-duoc-si/ChiTietYeuCauLienKetDuocSi";
import { YeuCauLienKetDuocSi } from "./yeu-cau-lien-ket-duoc-si/YeuCauLienKetDuocSi";
import { YeuCauLienKetToChuc } from "./yeu-cau-lien-ket-to-chuc/YeuCauLienKetToChuc";

const usersBreadcrumbs = [
  {
    title: "Trang chủ",
    path: "/",
    isSeparator: false,
    isActive: false,
  },
  {
    title: "",
    path: "",
    isSeparator: true,
    isActive: false,
  },
];

const YeuCauLienKetPage = () => {
  return (
    <Routes>
      <Route element={<Outlet />}>
        <Route
          path="yeu-cau-lien-ket-duoc-si"
          element={
            <>
              <PageTitle breadcrumbs={usersBreadcrumbs}>
                Yêu cầu liên kết dược sĩ
              </PageTitle>
              <YeuCauLienKetDuocSi />
            </>
          }
        />
        <Route
          path="yeu-cau-lien-ket-duoc-si/:id"
          element={
            <>
              <PageTitle breadcrumbs={usersBreadcrumbs}>
                Yêu cầu liên kết dược sĩ
              </PageTitle>
              <ChiTietYeuCauLienKetDuocSi />
            </>
          }
        />
        <Route
          path="yeu-cau-lien-ket-to-chuc"
          element={
            <>
              <PageTitle breadcrumbs={usersBreadcrumbs}>
                Yêu cầu liên kết tổ chức
              </PageTitle>
              <YeuCauLienKetToChuc />
            </>
          }
        />
      </Route>

      <Route
        index
        element={
          <Navigate to="/admin/yeu-cau-lien-ket/yeu-cau-lien-ket-duoc-si" />
        }
      />
    </Routes>
  );
};

export default YeuCauLienKetPage;
